func innerCollapse(input string) string {
	var collapsed strings.Builder

	var j int
	for i := 0; i < len(input); i++ {
		j = i + 1
		if j >= len(input) {
			collapsed.WriteByte(input[i])
			break
		}

		diff := math.Abs(float64(input[i]) - float64(input[j]))

		if diff == 32 {
			i++
			continue
		}

		collapsed.WriteByte(input[i])
	}

	return collapsed.String()
}

func collapse(input string) string {
	prevLen := 0

	for prevLen != len(input) {
		prevLen = len(input)
		input = innerCollapse(input)
	}

	return input
}

func findRunes(input string) map[rune]struct{} {
	runeMap := map[rune]struct{}{}

	for _, val := range input {
		runeMap[unicode.ToLower(val)] = struct{}{}
	}

	return runeMap
}

func removeUnits(input string, unit rune) string {
	var collapsed strings.Builder
	for _, r := range input {
		if unicode.ToLower(r) != unicode.ToLower(unit) {
			collapsed.WriteRune(r)
		}
	}

	return collapsed.String()
}

func findshortest(input string) (rune, string) {
	runeMap := findRunes(input)
	respMap := map[rune]string{}

	for r := range runeMap {
		resp := collapse(removeUnits(input, r))
		respMap[r] = resp
	}

	shortestLen := math.MaxInt32
	shortest := ""
	var shortestRune rune
	for r, collapsed := range respMap {
		if len(collapsed) < shortestLen {
			shortestLen = len(collapsed)
			shortest = collapsed
			shortestRune = r
		}
	}

	return shortestRune, strings.TrimSpace(shortest)
}

